import React from 'react';

const ViewCardContainer = styled()`
  display: flex;
  height: 540px;
  gap: 12px;
  border-color: #0B886D;
  border-radius: 8px;
  overflow: hidden;
  max-height: 480px;
`;

const ViewCard = () => {
    return (
      <>
        <ViewCardContainer/>
      </>
    );
};

export default ViewCard
